{"question": "What is the process for retrieving data from SQL Server in JSP?", "answer": "Here is a concise answer to the question:

To retrieve data from a database (e.g., SQL Server) in JSP, you need to:
1. Establish a connection to the database using `DriverManager.getConnection(url, uid, pw)`.
2. Create a `Statement` object using the connection.
3. Execute a SQL query using `stmt.executeQuery(sql)`, where `sql` is the query string.
4. Process the result set using a `ResultSet` object, retrieving data with methods like `rst.getString(1)` and `rst.getDouble(2)`.
5. Close the connection and statement when done.

