{"question": "Can you explain 'instanceof' with an example of unrelated classes?", "answer": "Here's an explanation of 'instanceof' with an example of unrelated classes:

The `instanceof` operator is used to test whether an object is an instance of a particular class or its subclass. For example, consider two unrelated classes, `Vehicle` and `Fruit`. If you have an object reference `obj` of type `Object`, you can use the `instanceof` operator to check if it's an instance of `Vehicle` or `Fruit`.

Example:
```
Object obj = new Vehicle();
if (obj instanceof Vehicle) {
    System.out.println("It's a Vehicle");
} else if (obj instanceof Fruit) {
    System.out.println("It's a Fruit");
}
```
In this case, since `obj` is an instance of `Vehicle`, the output would be "It's a Vehicle". If `obj` were an instance of `Fruit`, the output would be "It's a Fruit".", "sourceDocuments": [{"content": "COSC 121. Page 20
