{"question": "How do you debug a program in Java?", "answer": "To debug a program in Java using Eclipse, you start by setting a breakpoint in your code where you want to observe how the program proceeds. Then, you start the Eclipse debugger, which will pause the program at the breakpoint and wait for your instructions. From there, you can single-step through your program, tracing the code and observing how the variables change. This allows you to identify and correct errors in your code.", "sourceDocuments": [{"content": "COSC 111. Page 53
Basic concepts
Debugger: a tool that allows you to run a program interactively 
while watching how your code runs and how the variables 
change.
▪To start debugging your code, do one of the following:
•right click on the class file and select Debug As →Java Application
•From the Run menu, choose Debug. 
•Click the debug button.
▪This will open the Debug perspective in Eclipse.
•You can switch to the default Java perspective by choosing Window 
menu →Open perspective →Java Browsing.
Breakpoint: a point in your source code where the program 
execution stops during debugging. 
▪Once the program stops, you can inspect the variables and run 
the program in a controlled manner. 
▪To define a breakpoint in your program, do one of the following:
•double-click in the left margin of the Java editor in Eclipse.
•right-click in the left margin and select Toggle Breakpoint.", "docName": "L13_Methods_Overloading_varScope_(ch6_part2)", "sourceLink": "testSource", "pageNumbers": [53, 51]}, {"content": "Q4. [6 marks] This question has a quick tutorial on the Eclipse Debugger tool. 
