{"question": "What does the 'continue' statement do in a loop?", "answer": "The 'continue' statement in a loop ends the current iteration and program control goes to the next iteration. It skips the remaining statements in the current iteration and proceeds to the next iteration.", "sourceDocuments": [{"content": "COSC 111. Page 29
Liang, Introduction to Java Programming, Tenth Edition, (c) 2015 Pearson Education, Inc. 
continue
You can also use the continue keyword in a loop. When it is 
encountered, it ends the current iteration and program control 
goes to the next iteration.

public class TestContinue { 
  public static void main(String[] args) { 
    int sum = 0; 

int number = 0;


    while (number < 20) { 

number++;

      if (number == 10 || number == 11)  
        continue; 
      sum += number; 
    } 
    System.out.println("The sum is " + sum); 
  } 
}", "docName": "L9_Loops_for_break_continue_(ch5_part2)", "sourceLink": "testSource", "pageNumbers": [29, 20]}, {"content": "COSC 111. Page 5
Repetition statement (loops)
Repetition statement: an action is repeated as long as a 
condition is true. 
We have two types of loops:
Counter-controlled repetition
•Repetition will exit after running a certain number of times.
•In a counter-controlled repetition, we have
•a control variable that acts as a counter.
•The control variable should be initializedbefore running the loop for the first 
time.
•the control variable should then be modified(incremented or decremented) 
each time through the loop.
•the loop-continuation-condition determines if looping should continue.
Sentinel-controlled repetition
•it is not known in advance how many times the loop will be executed. 
•A sentinel value (also called a signal value) is used to decide when to 
exit  the loop. 
•The sentinel value is specially used when reading and processing a set 
of values from, e.g., user input, text file, array, etc.", "docName": "L8_Loops_while_(ch5_part1)", "sourceLink": "testSource", "pageNumbers": [5]}], "courseId": "COSC111"}

