{"question": "How do you use the extended switch statement in Java?", "answer": "The extended switch statement in Java has two new forms introduced from Java 12 to 15. One is a simplified syntax, which combines multiple cases referring to the same code, and can be used when there are several cases that need to execute the same code. The other form is as an expression, where the switch statement returns a value. 

For example, the traditional switch statement: 
switch (day) {
case 2:
case 3:
case 4:
case 5:
case 6:
System.out.println("weekday");
break;
...

can be simplified to: 
switch (day) {
case 2,3,4,5,6:System.out.println("weekday");
break;
...", "sourceDocuments": [{"content": "COSC 111. Page 18
