Remember: Primitive vs. Reference Types
▪Java’s types are divided into:
▪1. Primitive types 
•Includes boolean, byte, char, short, int, long, float and 
double.
•A primitive-type variable stores, in its location in memory, a value of its 
declared type.
▪2. Reference types
•Includes all non-primitive types, (e.g., Arrays, Strings, Scanner, etc.)
•A reference-type variable (or a reference) stores, in its location in memory, 
data which Java uses to find the object in the memory.
•Such a variable is said to 
refer to an object in the program.
