{"question": "How do I validate a customer ID in JSP?", "answer": "You can validate a customer ID in JSP by executing a SQL query to check if the customer ID exists in the database. Here's an example:

```jsp
String customerId = request.getParameter("customerId");
// ...
String sqlCustomer = "SELECT COUNT(*) FROM customers WHERE customer_id = ?";
pstmtOrder = conn.prepareStatement(sqlCustomer);
pstmtOrder.setInt(1, Integer.parseInt(customerId));
rs = pstmtOrder.executeQuery();
rs.next();
if (rs.getInt(1) == 0) {
    out.println("Invalid customer id");
    return;
}
```

In this code snippet, a SQL query is executed to count the number of rows in the `customers` table where the `customer_id` matches the provided `customerId`. If the count is 0, it means the customer ID does not exist, and an error message is displayed.", "sourceDocuments": [{"content": "For Assignment 7, Question 2, I need to implement order.jsp to store an order and its products in the database. How can I validate the customer id, insert the order, and save the ordered products? Provide a code snippet demonstrating this functionality. To implement order.jsp and store an order with its products, you need to validate the customer id, insert the order, and save each product in the order. Here is a code snippet demonstrating this functionality:

```jsp
<%@ page import="java.sql.*" %>
<%@ page import="java.util.*" %>
<%
String customerId = request.getParameter("customerId");
List<String> cart = (List<String>) session.getAttribute("cart");
Connection conn = null;
PreparedStatement pstmtOrder = null;
PreparedStatement pstmtProduct = null;
ResultSet rs = null;
try {
    Class.forName("com.microsoft.sqlserver.jdbc.SQLServerDriver");
    String dbURL = "jdbc:sqlserver://cosc304_sqlserver:1433;DatabaseName=orders;TrustServerCertificate=True";
    conn = DriverManager.getConnection(dbURL, "username", "password");
    // Validate customer id
    String sqlCustomer = "SELECT COUNT(*) FROM customers WHERE customer_id = ?";
    pstmtOrder = conn.prepareStatement(sqlCustomer);
    pstmtOrder.setInt(1, Integer.parseInt(customerId));
    rs = pstmtOrder.executeQuery();
    rs.next();
    if (rs.getInt(1) == 0) {
        out.println("Invalid customer id");
        return;
    }
    // Insert order
    String sqlInsertOrder = "INSERT INTO orders (customer_id, order_date) VALUES (?, GETDATE())";
    pstmtOrder = conn.prepareStatement(sqlInsertOrder, Statement.RETURN_GENERATED_KEYS);
    pstmtOrder.setInt(1, Integer.parseInt(customerId));
    pstmtOrder.executeUpdate();
    rs = pstmtOrder.getGeneratedKeys();
    rs.next();
    int orderId = rs.getInt(1);
    // Insert order products
    String sqlInsertProduct = "INSERT INTO order_products (order_id, product_id) VALUES (?, ?)";
    pstmtProduct = conn.prepareStatement(sqlInsertProduct);
    for (String productId : cart) {
        pstmtProduct.setInt(1, orderId);
        pstmtProduct.setInt(2, Integer.parseInt(productId));
        pstmtProduct.executeUpdate();
    }
    out.println("Order placed successfully with Order ID: " + orderId);
    // Clear cart
    session.setAttribute("cart", new ArrayList<String>());
} catch (Exception e) {
    e.printStackTrace();
} finally {
    if (rs != null) try { rs.close(); } catch (SQLException ignore) {}
    if (pstmtOrder != null) try { pstmtOrder.close(); } catch (SQLException ignore) {}
    if (pstmtProduct != null) try { pstmtProduct.close(); } catch (SQLException ignore) {}
    if (conn != null) try { conn.close(); } catch (SQLException ignore) {}
}
%>
