{"question": "What isolation level should be used for reading account balances?", "answer": "For the readBalance() transaction, it is recommended to use READ COMMITTED or higher to ensure the correct balance is read without being affected by other concurrent transactions. The default isolation level might be sufficient, but using READ COMMITTED or higher provides extra protection against dirty reads.", "sourceDocuments": [{"content": "In COSC 404 Lab 8 on Transactions with Microsoft SQL Server, for the readBalance() transaction that reads a balance for a given account, do we need to handle any specific transaction isolation level or is the default level sufficient? For the readBalance() transaction, you should use the transaction isolation level that ensures the correct balance is read without being affected by other concurrent transactions. The default isolation level might be sufficient, but it's generally recommended to use READ COMMITTED or higher to avoid dirty reads.", "sourceLink": "inserted_questions", "pageNumbers": [0]}, {"content": "69
Isolation Example 
Read Committed
With read committed, each read will get the most recently committed 
values even if different than an earlier read.
•Read locks are released after every statement.  Write locks released at commit.
Example schedule:
After execution, total1 = $5000 and total2 = $5150 as the second read 
sees the newly inserted tuple and T1’s update.
SELECT SUM(balance) as total1 FROM Account;
UPDATE Account WHERE num= 'S1' SET balance=balance+50;
COMMIT T1;
INSERT INTO ACCOUNT (num, balance) VALUES ('S5' , 100); 
COMMIT T3;
SELECT SUM(balance) as total2 FROM Account;
COMMIT T2;", "docName": "404_11_Concurrency", "sourceLink": "testSource", "pageNumbers": [69]}], "courseId": "COSC404"}

