{"question": "Can you explain polymorphism in Java with an example?", "answer": "Here is a concise answer:

In Java, polymorphism is the ability of an object to take on many forms. It allows a supertype reference to refer to a subtype object, enabling a single method to perform different functions based on the object it's acting upon. For example, a method `displayName(Human h)` can display the name of various types of humans, such as `Student` or `GradStudent`, without knowing their specific type at compile time.", "sourceDocuments": [{"content": "Explain the concept of polymorphism in Java. Polymorphism in Java is the ability of an object to take on many forms. It allows a supertype reference to refer to a subtype object. This enables a single method to perform different functions based on the object it is acting upon. The main benefit is to allow one interface to be used for a general class of actions.", "sourceLink": "inserted_questions", "pageNumbers": [0]}, {"content": "COSC 121. Page 24
