{"question": "Can you give an example of inheritance in Java?", "answer": "Here's an example of inheritance in Java:

A `Circle` class can inherit from a `Shape` class. The `Shape` class has a field `color` and a method `setColor(String c)`. The `Circle` class inherits these fields and methods and adds its own field `radius` and method `getArea()`. This way, the `Circle` class reuses the code from the `Shape` class and introduces new functionalities.", "sourceDocuments": [{"content": "In the inheritance slide, you discussed the use of the 'extends' keyword. Can you explain why inheritance is beneficial in Java and provide an example? Inheritance is beneficial in Java because it promotes code reuse and logical hierarchy. It allows a new class (subclass) to inherit fields and methods from an existing class (superclass), thus enabling the subclass to reuse the code and add or override methods to introduce new functionalities. Example:

java
class Shape {
 String color;
 void setColor(String c) {
 color = c;
 }
}

class Circle extends Shape {
 double radius;
 double getArea() {
 return Math.PI * radius * radius;
 }
}

Here, Circle inherits the color field and setColor method from Shape and adds its own field and method.", "sourceLink": "inserted_questions", "pageNumbers": [0]}, {"content": "COSC 121. Page 8
