{"question": "Why can't you instantiate an abstract class in Java?", "answer": "You cannot instantiate an abstract class because it is meant to be a blueprint for other classes, and it may contain abstract methods that must be implemented by subclasses.", "sourceDocuments": [{"content": "Regarding the abstract classes slide, can you clarify why you cannot instantiate an abstract class and provide an example of when you might use one? You cannot instantiate an abstract class because it is meant to be a blueprint for other classes. Abstract classes can contain abstract methods, which are methods without a body that must be implemented by subclasses. They are used when you have a base class that should not be instantiated but still want to enforce a certain structure on the derived classes. Example:

java
abstract class Animal {
