Notes about abstract classes/methods
A class that contains abstract methods must be abstract. 
▪it is also possible to define abstract class with no abstract methods. 
A subclass can be abstract even if its superclass is concrete. 
▪Example: Objectclass is concrete, but its subclasses may be abstract.
An abstract subclass can override a concrete method from its 
superclass to define it abstract.
▪This is rare, but useful when the implementation of the method in the 
superclass becomes invalid in the subclass. 
You can define constructors in an abstract class, which are 
invoked in the constructors of its subclasses.
▪Remember that you cannot create objects of abstract classes.
You can create reference variables of an abstract-class type
▪Example: Shape shp= new Circle();", "docName": "L05_AbstratClasses_Interfaces_A_(Ch13)", "sourceLink": "testSource", "pageNumbers": [11]}], "courseId": "COSC121"}

