{"question": "What is dynamic binding in Java with an example?", "answer": "Dynamic binding in Java refers to the process where the method to be invoked is determined at runtime rather than compile-time. When a method is called on an object, the JVM determines the appropriate method implementation based on the actual object's type, not the reference type.

For example:
java
Shape shape = new Circle();
shape.draw(); // Calls Circle's draw method

Here, even though `shape` is a Shape reference, the `draw` method of Circle is called at runtime.", "sourceDocuments": [{"content": "Explain how dynamic binding works in Java, and provide an example demonstrating how method calls are resolved at runtime based on the actual object type. Dynamic binding in Java means that method calls are resolved at runtime. For example, if a superclass reference variable refers to a subclass object, the subclass method is executed. Example:
java
Shape shape = new Circle();
