{"question": "How can I optimize the `getNodeAt(int index)` method in MyDoublyLinkedList?", "answer": "To optimize the `getNodeAt(int index)` method, you can start from the head if the index is less than half the size of the list, and from the tail if the index is greater than or equal to half the size of the list. This reduces the number of iterations needed to find the node.", "sourceDocuments": [{"content": "I need to implement the `getNodeAt(int index)` method in my MyDoublyLinkedList class. How can I optimize this method using both `next` and `previous` references to improve performance? To optimize the `getNodeAt(int index)` method, you can start from the head if the index is less than half the size of the list, and from the tail if the index is greater than or equal to half the size of the list. This reduces the number of iterations needed to find the node. Here's a sample implementation:

```java
public Node<E> getNodeAt(int index) {
    if (index < 0 || index >= size) throw new IndexOutOfBoundsException();
    Node<E> current;
    if (index < size / 2) {
        current = head;
        for (int i = 0; i < index; i++) {
            current = current.next;
        }
    } else {
        current = tail;
        for (int i = size - 1; i > index; i--) {
            current = current.previous;
        }
    }
    return current;
}
```", "sourceLink": "inserted_questions", "pageNumbers": [0]}, {"content": "previous properly point to the correct nodes or to null.  
