```java
public Node<E> getNodeAt(int index) {
    if (index < 0 || index >= size) throw new IndexOutOfBoundsException();
    Node<E> current;
    if (index < size / 2) {
        current = head;
        for (int i = 0; i < index; i++) {
            current = current.next;
        }
    } else {
        current = tail;
        for (int i = size - 1; i > index; i--) {
            current = current.previous;
        }
    }
    return current;
}
