            ArrayList<Patient> list1 = (ArrayList<Patient>) list.clone();
            ArrayList<Patient> list2 = (ArrayList<Patient>) list.clone();

            long startTime = System.currentTimeMillis();
            Sorter.bubbleSort(list);
            long endTime = System.currentTimeMillis();
            System.out.println("Bubble Sort time for " + size + " patients: " + (endTime - startTime) + "ms");

            startTime = System.currentTimeMillis();
            Sorter.selectionSort(list1);
            endTime = System.currentTimeMillis();
            System.out.println("Selection Sort time for " + size + " patients: " + (endTime - startTime) + "ms");

            startTime = System.currentTimeMillis();
