{"question": "How can you calculate trip cost using a Java program?", "answer": "You can calculate the trip cost using a Java program by taking user inputs for distance, fuel efficiency, and price per gallon. Then, use the formula (distance / fuelEfficiency) * pricePerGallon to calculate the cost. Here's an example code:

```java
import java.util.Scanner;

public class Q2 {
    public static void main(String[] args) {
        Scanner input = new Scanner(System.in);
        System.out.print("Enter the distance to drive: ");
        double distance = input.nextDouble();
        System.out.print("Enter the fuel efficiency in miles per gallon: ");
        double fuelEfficiency = input.nextDouble();
        System.out.print("Enter the price per gallon: ");
        double pricePerGallon = input.nextDouble();
        double cost = (distance / fuelEfficiency) * pricePerGallon;
        System.out.println("The cost of the trip is $" + cost);
    }
}
```", "sourceDocuments": [{"content": "How can I write a Java program to calculate the cost of a trip given the distance, fuel efficiency, and price per gallon? Here's what I have so far: ``` import java.util.Scanner; public class Q2 { public static void main(String[] args) { Scanner input = new Scanner(System.in); System.out.print("Enter the distance to drive: "); double distance = input.nextDouble(); System.out.print("Enter the fuel efficiency in miles per gallon: "); double fuelEfficiency = input.nextDouble(); System.out.print("Enter the price per gallon: "); double pricePerGallon = input.nextDouble(); double cost = (distance / fuelEfficiency) * pricePerGallon; System.out.println("The cost of the trip is $" + cost); } } ``` Your code correctly calculates the cost of a trip. Just make sure to test it with various inputs to verify its accuracy. For example: ``` Enter the distance to drive: 100 Enter the fuel efficiency in miles per gallon: 25 Enter the price per gallon: 3.5 ``` This should output: ``` The cost of the trip is $14.0 ```", "sourceLink": "inserted_questions", "pageNumbers": [0]}, {"content": "COSC 111. Page 23
