Explicit & implicit calling of  superclass constructor
If no constructor is called within a given constructor, Java 
implicitly calls the super constructor. For example, the following 
two segments of code are equivalent:
CAUTION: You must use the keyword super to call the superclass 
constructor. Invoking a superclass constructor’s name in a subclass 
causes a syntax error. Java requires that the statement that uses the 
keyword super appear first in the constructor.
class A{
public A(){
System.out.print(1);
}
}
class B extends A{
public B(){
System.out.print(2);
}
}
class A{
public A(){
System.out.print(1);
}
}
class B extends A{
public B(){
super();
System.out.print(2);
}
}
